/*
** ===================================================================
**     Method      :  PTD_Init (component Init_GPIO)
**     Description :
**         This method initializes registers of the GPIO module
**         according to the Peripheral Initialization settings.
**         Call this method in user code to initialize the module. By
**         default, the method is called by PE automatically; see "Call
**         Init method" property of the component for more details.
**     Parameters  : None
**     Returns     : Nothing
** ===================================================================
*/
void PTD_Init(void)
{
  /* GPIOD_PSOR: PTSO&=~0x10,PTSO|=0x20 */
  GPIOD_PSOR = (uint32_t)((GPIOD_PSOR & (uint32_t)~(uint32_t)(
                GPIO_PSOR_PTSO(0x10)
               )) | (uint32_t)(
                GPIO_PSOR_PTSO(0x20)
               ));
  /* GPIOD_PCOR: PTCO&=~0x20,PTCO|=0x10 */
  GPIOD_PCOR = (uint32_t)((GPIOD_PCOR & (uint32_t)~(uint32_t)(
                GPIO_PCOR_PTCO(0x20)
               )) | (uint32_t)(
                GPIO_PCOR_PTCO(0x10)
               ));
  /* GPIOD_PDDR: PDD&=~0xD6,PDD|=0x28 */
  GPIOD_PDDR = (uint32_t)((GPIOD_PDDR & (uint32_t)~(uint32_t)(
                GPIO_PDDR_PDD(0xD6)
               )) | (uint32_t)(
                GPIO_PDDR_PDD(0x28)
               ));
}

